import Trafficform from './Trafficform';


class Datetime extends Component {
    constructor(props)
    {
      super(props)
      this.state={
  time:""
      }
    }

    componentDidMount()
    {

        const timestamp = Date.now(); // This would be the timestamp you want to format

      //console.log(new Intl.DateTimeFormat('en-US', {year: 'numeric', month: '2-digit',day: '2-digit', hour: '2-digit', minute: '2-digit', second: '2-digit'}).format(timestamp));
      this.setState({
        time:new Intl.DateTimeFormat('en-US', {year: 'numeric', month: '2-digit',day: '2-digit', hour: '2-digit', minute: '2-digit', second: '2-digit'}).format(timestamp)
      })
    }



    render() {

        return (
         <div>

      <Trafficform time={this.state.time}/>

         </div>
        ); 


    }
  }



export default Datetime
